INSERT INTO `announcement` VALUES (10,'66e692af3ff4f','Esinam Adzimah - Birthday Thanks Giving','<p>I thank God for adding another year to my year and Has also been good to me.</p>','Main Church','September','2024','Active','2024-Sep-15th','undefined'),(9,'66caef0c53087','Birthday Unkwown ','<p>I thank God for giving I and my son another year. We humbly ask God for Blessings&nbsp;</p>','Main Church','August','2024','Active','2024-Aug-25th','undefined'),(8,'66caee8e7f66b','Rebecca Boahen Thanks Giving','<p>I thank God for taking care in an accident. I am safe and well</p>','Main Church','August','2024','Active','2024-Aug-25th','undefined'),(11,'66e692e3314d9','Maame Diana - ThanksGiving','<p>I thank God for His Healing Mercy on me.</p>','Main Church','September','2024','Active','2024-Sep-15th','undefined'),(12,'66e6937b72353','Paulina Birago - Funeral Thanks Giving','<p>I thank God for the burial of my father and for making go well during the funeral.</p><p>I also thank our Pastor Rev. Prince Atta Poku for remembering me in his Prayers.</p>','Main Church','September','2024','Active','2024-Sep-15th','undefined'),(13,'66e695d35a876','Veronica Aboagye - Thanks Giving','<p>I thank God for my son\'s Graduation and also brought him back home safely.</p>','Main Church','September','2024','Active','2024-Sep-15th','undefined'),(14,'66e69c9ed20ac','Prempeh Sylvester  -  Employment','<p>I am a Taxi driver looking for a car to drive . I anyone can assist me&nbsp;</p>','Main Church','September','2024','Active','2024-Sep-15th','undefined'),(15,'66e69d2694a53','Cynthia Agyei Yeboah - Thanks Giving ','<p>I thank for saving my son from&nbsp; blood vomiting after i gave him the HOP water.</p>','Main Church','September','2024','Active','2024-Sep-15th','undefined'),(16,'66e69fae8d217','Ocansey Happy - Thanks Giving ','<p>I thank God for saving me from Thieves after they took the money I withdraw from the bank without hurting me.</p>','Main Church','September','2024','Active','2024-Sep-15th','Darren Apetorgbor Agbeve'),(17,'66efca5611bc2','Frederick Birikorang - Thanks Giving','<p>I thank God Helping my son to Graduate from Secondary school</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(18,'66efca8a208dd','Alberta Afla - Thanks Giving ','<p>I thank God for Adding Another year to my year</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(19,'66efcadb20550','Mr & Mrs Asante','<p>We thank God For adding a year to our daughter\'s year</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(20,'66efcb44c65ec','Faustina Ofosuaa - Thanks Giving ','<p>I thank God for helping my son to graduate from Secondary School</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(25,'66efcca0937f6','Prempeh Sylvester - Job Search','<p>I am a professional taxi driver looking for taxi to work.</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(24,'66efcc587c820','Prempeh Silvester - Thank Giving','I thank God protecting me from fire outbreak at Community 12. I am very Grateful to the almighty God','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(23,'66efcbb10a1d7','Anthony Nkyi - Thanks Giving','<p>I thank for adding another year to my year without any sickness or disease.</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(26,'66efcf7a9da01','Agya Appiah Augustine - Thanks Giving','<p>I thank God for the successfull burial of my Moher at Asaman kesse Akanteng</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(27,'66efdd6664b34','Nomi Dakora - Thanks Giving','<p>I thank God for helping my children to graduate from Secondary school.</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(28,'66efde57c4824','Theophilus Quartey - Thank Giving','<p>I thank God for Graduation of my two children. One from secondary school and the other child from Junior high school</p><p><b>Names</b></p><p>Princess Quartey - JHS GRADUATE</p><p>Lina Quartey - SHS GRADUATE&nbsp;</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(29,'66efdfbd040c7','Paul Essel - Thanks Giving','I thank God for successful Surgery of my friend after i gave him the HOP wrist band.','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(30,'66efe1cd4bb61','Akua Grace -  Thanks Giving ','<p>I thank God for the graduation of my 4 children from secondary school</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(31,'66efe618cdbbd','  Thanks Giving - GIDEON ADIDI','<p>&nbsp; I Thank God for adding another year to my year. God has been faithful to me!!</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(32,'66efea047898c','Mrs. Tieku  - Thanks Giving','<p>1. I thank God for me Mercy by raising up from my sickness. </p><p>2. I also thank God for saving my little son from injury when a motorbike fell on his legs.</p>','Main Church','September','2024','Active','2024-Sep-22nd','undefined'),(33,'66f907c9b10c1','BENJAMIN NARTEY ADDO - THANKS GIVING','I thank God&nbsp; for showing me Healing Mercies as i was feeling pains in my leg during the weekdays but now i am fit and well','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(34,'66f908004ea18','Fulera Alhassan - Thanks Giving ','<p>I thank God for adding another year to my year.</p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(35,'66f90833bb6a3','Tigar David - THANKS GIVING','I thank God for healing my sickness.','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(36,'66f9089c01f3c','Esther Offei - Thanks Giving','<p>I thank God for a successful burial service for my late Mum and I also Thank for taking my husband from sick bed now He is fit and well.</p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(37,'66f9091b4b9c0','Funeral Announcement - Anita Badu Ofoe','<p>I am cordially inviting my fellow members of the Church that my Fathers funeral at Gomoa Asikuma.</p><p><br></p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(38,'66f9099fb02fd','Roberta Partey - Thanks Giving','<p>My younger child swallowed a metallic object but by the Grace of God He vomit it out. I thank God for showing me mercy.</p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(39,'66f909d515e9c','Men\'s fellowship Metting ','<p>There will be a brief meeting after Church service.</p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(40,'66f9100f870af','JAMA GROUP','<p>There will be our Main training session today. We are also inviting interested members to also come and join</p><p><font color=\"#000000\" style=\"\"><b>Note: no member should be absent from this meeting.</b></font></p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(41,'66f9125c7c419','Youth Meeting ','<p>There will be a brief meeting after Church Service.</p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(42,'66f91297d7643','Ante Esther - Thanks Giving','<p>I thank God for the graduation of my daughter from Secondary school.</p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(43,'66f916a394830','Mama Theresah  - Thanks Giving','<p>I thank God for saving me from an Accident. I and my Family give a big Thank you to the Almighty God</p>','Main Church','September','2024','Active','2024-Sep-29th','undefined'),(44,'67023f84dd8a0','Maa Rita - Thanks Giving','<p>I thank God for adding another year to my (2)two children.</p>','Main Church','October','2024','Active','2024-Oct-6th','undefined'),(45,'6702423ee571f','Alice Acquaye - Testimony','Last Tuesday I went for a Family meeting at Amasaman and while I was seated under a tree, a snake fell from the tree to my back. I was not a aware it is a snake until the people around me